import React from 'react';
import {Charts,Cards,CountryPicker} from './Components';
import styles from './app.module.css';
class App extends React.Component {
    render() {
        return (
            <div className={styles.container}>
                <Cards/>
                <Charts/>
                <CountryPicker/>
                <h1>Hello</h1>
            </div>
        )
    }
}
export default App;
